import { getStrapiMedia } from '~/utils/medias';
export default {
  methods: {
    getStrapiMedia: getStrapiMedia
  },
  computed: {
    pages: function pages() {
      // Select random project index
      var projects = this.$static.strapi.projects;
      var randomIndex = Math.floor(Math.random() * projects.length);
      return [{
        title: 'Home',
        path: '/'
      }, {
        title: 'About',
        path: '/about'
      }, {
        title: 'Random project',
        path: "/project/".concat(projects[randomIndex].slug)
      }];
    }
  }
};
